            "merchant_acquiring_title":"Advanced and tailored solutions for merchant acquiring",
            "merchant_acquiring_subtitle":"Araripe Expert Acquiring Solution offers technologically advanced payment acquiring services specifically designed to meet diverse needs of Payment Service Providers for merchant acquiring.",
            "merchant_acquiring_text":"We offer multi-currency Acquirer authorisation, clearing and settlement services in 12 currencies across over 30 countries.",

            "about_block":"Never ending technological progress brings higher convenience and efficiency in processes that span the payment industry. We work hard to stay relevant in this constantly changing environment to provide reliable payment services and support to the most demanding clients and businesses.",
            "about_about_text1":"Araripe is an international company providing high-tech services in the field of Internet acquiring to corporate clients around the world.",
            "about_about_text2":"The company's work is based on an individual approach to the requirements of each client, and we are ready to offer our customers only the best-in-class solutions. Our solutions include: modern technologies, processing of online payments, electronic wallets, money transfer services, issue of payment cards, etc. .",
            "about_about_text3":"Araripe is headquartered in London, and has a number of offices in various countries around the world.",
            "about_office_text1":"Araripe  is headquartered in London, in the beating heart of the Fintech industry. Built on the latest technologies, our solutions and services bring so much needed mobility to the financial world. From online payment processing and money transfer services to payment card issuance – we offer everything you need for your online business.",
            "about_office_text2":"And our passion doesn’t end there. The right combination of technical know-how, market expertise and advanced technologies allow us to deliver unique and unrivalled services to our clients and partners worldwide.",
            "about_office_text3":"Araripe is the official service provider for international payment services. Araripe holds the Principal Member status of Visa International and MasterCard Worldwide.",
